import "./App.css";
import theme from "./theme";
import { ThemeProvider } from "@material-ui/core/styles";
import { Typography } from "@material-ui/core";
import SignInPic from '../src/assets/Fridge-signin-pic.png';
import WorldMap from '../src/assets/Fridge-signin-pic.png';


function App() {
  return (
    <ThemeProvider theme={theme}>
      <Typography variant="h1">Hello World</Typography>
      <img src={SignInPic} alt="fireSpot"/>
    </ThemeProvider>

  );
}

export default App;
